SELECT COUNT(DISTINCT customer) FROM customers 
JOIN coverages ON customers.id = coverages.customer 
WHERE coverages.payer = 'b046940f-1664-3047-bca7-dfa76be352a4';

SELECT DISTINCT p.marital\_status
FROM patients p
WHERE p.ssn IN ('Kermit56', 'Rutherford999');

SELECT DISTINCT e.description FROM encounters e
JOIN supplies s ON e.id = s.encounter
WHERE s.description = 'CPAP/BPAP oral mask (physical object)';

SELECT DISTINCT e.description FROM encounters e
JOIN care\_plans cp ON e.id = cp.encounter
WHERE cp.description = 'Musculoskeletal care';

SELECT DISTINCT s.description FROM symptoms s
JOIN allergies a ON s.id = a.symptom
WHERE a.description = 'House dust mite (organism)';

SELECT COUNT(DISTINCT medication) FROM medications m
JOIN payers p ON m.payer = p.id
WHERE p.name = 'Humana';

SELECT DISTINCT e.description FROM encounters e
JOIN procedures p ON e.id = p.encounter
WHERE p.code = '428211000124100';

SELECT COUNT(DISTINCT medication) FROM medications m
JOIN encounters e ON m.encounter = e.id
WHERE e.payer = 'NO_INSURANCE';

SELECT DISTINCT careplans.reasoncode FROM careplans 
JOIN careplan_codes cpc ON careplans.id = cpc.careplan 
WHERE cpc.code = '134435003';

SELECT COUNT(DISTINCT m.id) FROM medications m
JOIN coverages c ON m.id = c.medication
WHERE c.payer = '26aab0cd-6aba-3e1b-ac5b-05c8867e762c' AND c.coverage = false;

SELECT DISTINCT i.date FROM immunizations i JOIN administered_vaccines av ON i.id = av.immunization 
JOIN vaccines v ON av.vaccine = v.id 
WHERE v.description = 'Influenza seasonal injectable preservative free';

SELECT DISTINCT device.udi FROM device 
JOIN deviceallergy ON device.id = deviceallergy.device 
WHERE deviceallergy.allergy = '337414009';

SELECT COUNT(DISTINCT patient) FROM allergies 
JOIN findings ON allergies.finding = findings.id 
WHERE findings.description = 'Allergy to substance (finding)';

SELECT DISTINCT i.body\_site\_description 
FROM imaging\_studies i 
WHERE i.series\_uid = '1.2.840.99999999.1.60733233.1559399876087';

SELECT COUNT(DISTINCT p.id) FROM patients p
JOIN allergies a ON p.id = a.patient
WHERE a.code = '419199007';
